import React from 'react'
import ExpenseItem from './ExpenseItem'
import "./Expences.css"
function Expenses() {
    let expence=[
        { id:1,
          Date:new Date(2021,3,28),
          Title:"school fee",
          Amount:200
        }
      ]
  return (
    <div>
        <ExpenseItem date={expence[0].Date}
      title={expence[0].Title}
      amount={expence[0].Amount} />
    </div>
  )
}

export default Expenses
